import React, {Component} from 'react'

function MenuButton(props) {
	return (
		<a className='inline-block border border-white rounded hover:border-gray-200 text-blue-500 hover:bg-gray-200 py-1 px-3' href='{props.href}'>
			{props.label}
		</a>
	);
}

class Header extends Component {
	render() {
		return (
			<nav className='flex items-center justify-between flex-wrap p-6'>
				<div>Logo</div>

				<ul className='flex'>
					<li className='mr-3'><MenuButton href='#' label='Home' /></li>
					<li className='mr-3'><MenuButton href='#' label='Tasks' /></li>
					<li className='mr-3'><MenuButton href='#' label='Logout' /></li>
				</ul>
			</nav>
		);
	}
}

export default Header;
